import React from "react";
import styled, { ThemeProvider } from "styled-components";
import { Header, Transition, Button, Particles } from "arclight-react";

const _Header_ = styled.div``;

export default class _ extends React.Component {
  render() {
    return (
      <ThemeProvider theme={{}}>
        <_Header_>
          <Header
            name={"StylishCenter"}
            textDisplay={{
              left: (
                <Transition trans={{ animation: "fadeInLeft", delay: 2 }}>
                  <h1>
                    <b>
                      <i>Titan eSports</i>
                    </b>
                  </h1>
                </Transition>
              ),
              center: null,
              right: (
                <Transition trans={{ animation: "fadeInRight", delay: 2 }}>
                  <img src={require("./img/divinity.png")} height={"45px"} />
                </Transition>
              ),
            }}
            theme={"Dark"}
            info={{
              width: "100%",
              height: "175px",
              crown: (
                <Transition trans={{ animation: "fadeIn", delay: 1.25 }}>
                  <div
                    style={{
                      position: "relative",
                      width: "125px",
                      height: "150px",
                    }}
                  >
                    <img
                      src={require("./img/logo-divinity.png")}
                      style={{
                        height: "150px",
                      }}
                    />
                    <div style={{ position: "absolute", top: -20, left: -55 }}>
                      <Particles
                        width={300}
                        height={200}
                        animations={[
                          {
                            name: "spiritual",
                            particleColor: "#00fff0",
                            x: 50,
                            y: 100,
                          },
                        ]}
                        invoke={false}
                      />
                    </div>
                  </div>
                </Transition>
              ),
            }}
            controls={[]}
          />
        </_Header_>
      </ThemeProvider>
    );
  }
}
